import Profile from "../images/realtor-1.jpeg";
import { signOut } from "firebase/auth";

const Navbar = () => {
  return (
    <div className={"navbar"}>
      <span className="logo">Dev Chat</span>
      <div className="user">
        <img src={Profile} alt="" />
        <span>John</span>
        <button onClick={() => signOut()}>Logout</button>
      </div>
    </div>
  );
};

export default Navbar;
